import './myComponents/styles/nav.css';
import './myComponents/styles/Home.css';
import Navbar from './myComponents/nav';
import Home from './myComponents/Home';
import Course from './myComponents/Course';
import {  BrowserRouter as Router,BrowSwitch, Route,} from 'react-router-dom';
function App() {
  return (
  <div> 

      <Navbar />
      <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
        </Switch>




    </div>
  );
}

export default App;
